from typing import List

### Monotonic Decreasing Stack
class Solution:
    def dailyTemperatures(self, temperatures: List[int]) -> List[int]:
        wait_days = []
        flag = False
        for i in range(len(temperatures)-1):
            # print("new temperature", i, temperatures[i])
            future = i+1
            wait = 1
            if temperatures[i] < temperatures[i+1]:
                # print("adding 1:", wait, wait_days)
                wait_days.append(wait)
            else:
                while future <= len(temperatures) and temperatures[i] >= temperatures[future]:
                    
                    future += 1
                    wait += 1
                    if future == len(temperatures):
                        #did not find warmer date in the future
                        wait_days.append(0)
                        break
                    else:
                        # print("here:", i, wait)
                        wait_days.insert(i, wait)
                # print("adding non 1:", wait, wait_days)
        wait_days.append(0)
        return wait_days
    
if __name__ ==  "__main__":
    solution = Solution()

